import React from "react";
import "./App.css";

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/questions")
      .then((res) => res.json())
      .then((data) => setData(data));
  });
  return (
    <div className="App">
      <p>{data[1].question}</p>
      <p>{data[1].correct}</p>
      <p>{data[1].alphaincorrect}</p>
      <p>{data[1].bravoincorrect}</p>
      <p>{data[1].charlieincorrect}</p>
    </div>
  );
}

export default App;
